import ExpenseDate from "./ExpenseDate";
const ExpenseItem = (props) => {
  return (
    <div>
      <ExpenseDate></ExpenseDate>
      <div>{props.date.toISOString()}</div>
      <div>{props.title}</div>
      <div>{props.price}</div>
    </div>
  );
};

export default ExpenseItem;
